import React, { useState } from "react";
//import * as List from "./temp";

const App = () => {
  let Time = new Date().toLocaleTimeString();

  const [Ctime, SetCtime] = useState(Time);

  const Set = () => {
    let Time = new Date().toLocaleTimeString();
    SetCtime(Time);
  };
  return (
    <>
      <h1>{Ctime}</h1>
      <button onClick="Set">Click me</button>
    </>
  );
};

export default App;
